import React from 'react';
import Card from './components/card/Card';
import './global.ts';
import { Container } from './styles';
import { GlobalStyle } from "./global";


function App() {
  let dadosCard = {
    domingo : [1,2,3,4,5]
  };

  let card = <Card
      dias={dadosCard}
  ></Card>;

  return (
    <Container>
      {card}
      <GlobalStyle />
    </Container>
  );
}
export default App;
